import React from 'react'


export default function ItemDetail({ producto }) {
  return (
    <div>
      {!producto.id && "Loading..."}
      <div key={producto.id}>
        {JSON.stringify(producto)}
        <br />
        <br />
      </div>
    </div>
  )
}
